import React from "react";
import { Col, Row } from "react-bootstrap";
import { CgCPlusPlus } from "react-icons/cg";
import {
  DiPython,
  DiJavascript1,
  DiGit,
  DiJava,
  DiDatabase,
} from "react-icons/di";
import {
  SiMysql,
  SiPostgresql,
  SiMongodb,
  SiBurpsuite,
  SiWireshark,
  SiNmap,
  SiOpenvpn,
  SiNessus,
  SiGhidra,
  SiIdapro,
  SiMicrosoft,
  SiLinux,
  SiCloudflare,
  SiSplunk,
  SiElasticsearch,
} from "react-icons/si";
import { FaUserSecret, FaShieldAlt, FaBug } from "react-icons/fa";

function Techstack() {
  return (
    <Row style={{ justifyContent: "center", paddingBottom: "50px" }}>
      {/* Programming Languages */}
      <Col xs={4} md={2} className="tech-icons"><CgCPlusPlus /></Col>
      <Col xs={4} md={2} className="tech-icons"><DiJava /></Col>
      <Col xs={4} md={2} className="tech-icons"><DiPython /></Col>
      <Col xs={4} md={2} className="tech-icons"><DiJavascript1 /></Col>

      {/* Databases */}
      <Col xs={4} md={2} className="tech-icons"><SiMysql /></Col>
      <Col xs={4} md={2} className="tech-icons"><SiPostgresql /></Col>
      <Col xs={4} md={2} className="tech-icons"><SiMongodb /></Col>

      {/* Cybersecurity Tools */}
      <Col xs={4} md={2} className="tech-icons"><FaUserSecret /></Col>
      <Col xs={4} md={2} className="tech-icons"><FaBug /></Col>
      <Col xs={4} md={2} className="tech-icons"><FaShieldAlt /></Col>
      <Col xs={4} md={2} className="tech-icons"><SiNmap /></Col>
      <Col xs={4} md={2} className="tech-icons"><SiWireshark /></Col>
      <Col xs={4} md={2} className="tech-icons"><SiBurpsuite /></Col>
      <Col xs={4} md={2} className="tech-icons"><SiGhidra /></Col>
      <Col xs={4} md={2} className="tech-icons"><SiIdapro /></Col>
      <Col xs={4} md={2} className="tech-icons"><SiNessus /></Col>
      <Col xs={4} md={2} className="tech-icons"><SiOpenvpn /></Col>

      {/* Cloud & Security Technologies */}
      <Col xs={4} md={2} className="tech-icons"><SiLinux /></Col>
      <Col xs={4} md={2} className="tech-icons"><SiMicrosoft /></Col>
      <Col xs={4} md={2} className="tech-icons"><SiCloudflare /></Col>
      <Col xs={4} md={2} className="tech-icons"><SiSplunk /></Col>
      <Col xs={4} md={2} className="tech-icons"><SiElasticsearch /></Col>

      {/* Version Control */}
      <Col xs={4} md={2} className="tech-icons"><DiGit /></Col>
    </Row>
  );
}

export default Techstack;
